import React, { useState } from "react";

import "./App.css";
import Input from "./Components/Input";

const [data, setData] = useState("");
function App() {
  return (
    <div>
      <Input
        type="text"
        value={(e: any) => {
          setData(e.target.value);
        }}
      />
      <p>{data}</p>
    </div>
  );
}

export default App;
